configure:
  commands:
    end:
      new_state: execute
    ip access-list extended racl_ipv41: "ip access-list extended racl_ipv41\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    permit tcp any any range 5500 5600: "permit tcp any any range 5500 5600\r\n"
  prompt: mac-gen1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: mac-gen1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: mac-gen1#
